Studio: Marc Dorcel

Cast: Aleska Diamond, Anna Polina, Jenna Lovely, Tarra White, Anissa Kate, Jenny, Leila, Nicoletta, Samantha Jolie, Victoria Sweet, Danny D, Martin Gun

Genres: Feature, Couples



If the end of the world happened tomorrow, which perversions would you care to taste, which ultimate sexual pleasure would you chose to devote your last moments to ?
December 21st is approaching, and with it the end of all things ; an appetite for sex takes over those who are waiting. As Tarra remembers her most feverish sexual memories, her husband Mike plays dangerous games with both Anna, his sexy assistant, and a luscious brunette beauty. Will they find a way to escape the forthcoming chaos, is there a solace in the last orgy before the apocalypse?






